<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y31 w0 h18" alt="" src="bg2.png"/><div class="c x0 y32 w0 h19"><div class="t m0 x1d h1a y33 ff2 fs5 fc0 sc0 ls0 ws0">Invoice</div></div><div class="c x0 y34 w13 h1b"><div class="t m0 x2a h10 y35 ff3 fs4 fc2 sc0 ls2 ws0">Total (Including Taxes, Fees &amp; Surcharges)</div></div><div class="c x2b y34 w14 h1b"><div class="t m0 x2c hf y35 ff1 fs4 fc8 sc0 ls0 ws0">$0.00 <span class="fc9"> </span></div></div><div class="t m0 x2d h1c y36 ff1 fs6 fc3 sc0 ls0 ws0">        <span class="fs7">Need help understanding your invoice?</span></div><div class="t m0 x2e h10 y37 ff3 fs4 fca sc0 ls0 ws0">Zoom Meetings Basic, Standard Pro and Standard Biz are now called Zoom One Basic, Zoom One Pro and Zoom One Business.</div><div class="c x0 y38 w15 h1d"><div class="t m0 x14 h1e y39 ff7 fs7 fc8 sc0 ls2 ws0">This plan includes products with monthly and/or yearly subscription periods. The subscription period for each plan, </div><div class="t m0 x14 h1e y3a ff7 fs7 fc8 sc0 ls2 ws0">and the total charge, $14.99 (plus applicable taxes and regulatory fees), per subscription period for that product are </div><div class="t m0 x14 h1e y3b ff7 fs7 fc8 sc0 ls2 ws0">set out above in the Charge Details section. Unless you cancel, your subscription(s) will auto-renew each subscription </div><div class="t m0 x14 h1e y3c ff7 fs7 fc8 sc0 ls2 ws0">period and each subscription period thereafter, at the price(s) listed above (plus any taxes and regulatory fees </div><div class="t m0 x14 h1e y3d ff7 fs7 fc8 sc0 ls2 ws0">applicable at the time of renewal) and your payment method on file at <span class="fcb">zoom.us/billing</span> will be charged. You can cancel </div><div class="t m0 x14 h1e y3e ff7 fs7 fc8 sc0 ls2 ws0">auto-renewal anytime, but you must cancel by the last day of your current subscription period to avoid being charged </div><div class="t m0 x14 h1e y3f ff7 fs7 fc8 sc0 ls2 ws0">for the next subscription period. You will not be able to cancel your &apos;&apos;base plan&apos;&apos; (Zoom Meetings, Zoom Phone, or </div><div class="t m0 x14 h1e y40 ff7 fs7 fc8 sc0 ls2 ws0">Zoom Rooms) without first canceling all other subscriptions in your plan. If you cancel, you will not receive a refund </div><div class="t m0 x14 h1e y41 ff7 fs7 fc8 sc0 ls2 ws0">for the remainder of your then-current subscription period. You can cancel by navigating to <span class="fcb">zoom.us/billing</span> and </div><div class="t m0 x14 h1e y42 ff7 fs7 fc8 sc0 ls2 ws0">clicking &apos;&apos;Cancel Subscription,&apos;&apos; clicking through the prompts, and then clicking to confirm cancellation. Should Zoom </div><div class="t m0 x14 h1e y43 ff7 fs7 fc8 sc0 ls2 ws0">change its pricing, it will provide you with notice, and you may be charged the new price for subsequent subscription.</div></div><div class="t m0 x2a h10 y44 ff3 fs4 fca sc0 ls0 ws0"> </div><div class="c x2f y45 w16 h1f"><div class="t m0 x30 h20 y46 ff4 fs8 fc0 sc0 ls3 ws0">CLICK HERE</div></div><a class="l" href="https://support.zoom.us/hc/en-us/articles/360057516312-Understanding-your-invoice-"><div class="d m1" style="border-style:none;position:absolute;left:355.100006px;bottom:615.750000px;width:82.000000px;height:23.150024px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
